import React, { Component } from 'react';
import logo from '../../../images/logo.svg';
import cart from '../../../images/cart.svg';
class HomeScreen extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo01" aria-controls="navbarTogglerDemo01" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarTogglerDemo01">
                        <img className="navbar-brand" src={logo} alt="logo" style={{ height: 71}}/>
                            <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                                <li className="nav-item active">
                                    <a className="nav-link" >Home <span class="sr-only">(current)</span></a>
                                </li>
                                <li className="nav-item active">
                                    <a className="nav-link" >shop</a>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link active" >magazine</a>
                                </li>
                            </ul>
                    <div class="form-inline my-2 my-lg-0" >
                        < img className="form-control mr-sm-2" src="{cart}" alt="cart" /> 
                        <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
                    </div>
                    </div>
                </nav>
            </div>
        );
    }
}

export default HomeScreen;
